geregisseerd door Andrew Hyatt
met Seth David Mitchell, Brit Morgan en Noah Segan

Na een aangrijpend ongeval met een sneeuwscooter strandt een jong stel in de bossen en moeten ze zien te overleven totdat er hulp arriveert. De zaken worden echter schrijnend wanneer Emma's vriend verdwijnt, waarna ze plots op zichzelf is aangewezen. Ze zal niet alleen moeten vechten tegen de elementen maar het ook op moeten nemen tegen een mysterieuze jager die haar opjaagt in de bossen.



